define({"topics" : [{"title":"Renaming Sets of Fields","shortdesc":"\n               <p class=\"shortdesc\">You can use regular expressions, or <dfn class=\"term\">regex</dfn>, along with the StreamSets             <a class=\"xref\" href=\"datacollector\/UserGuide\/Expression_Language\/ExpressionLanguage_overview.html#concept_p54_4kl_vq\">expression language</a> to rename sets of fields. You can use regex to define the         set of source fields to rename and to define the target\n                  field names. You can also use the         StreamSets expression language to define target field names.\n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/FieldRenamer.html#concept_ogb_bqf_lw","attributes": {"data-id":"concept_ogb_bqf_lw",},"menu": {"hasChildren":false,},"tocID":"concept_ogb_bqf_lw-d46e119797","topics":[]},{"title":"Configuring a Field Renamer","href":"datacollector\/UserGuide\/Processors\/FieldRenamer.html#task_y5g_4hh_ht","attributes": {"data-id":"task_y5g_4hh_ht",},"menu": {"hasChildren":false,},"tocID":"task_y5g_4hh_ht-d46e119828","topics":[]}]});